import React from "react";
import ControlPointIcon from "@material-ui/icons/ControlPoint";
import { TextField, makeStyles } from "@material-ui/core";

import "./index.scss";

const useStyles = makeStyles((theme) => ({
  paper: {
    margin: theme.spacing(0, 4),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
}));

export const RegisterThree = () => {
  const classes = useStyles();
  return (
    <div className={classes.paper}>
      <p className="field-label">Facebook</p>
      <TextField
        variant="outlined"
        margin="normal"
        required
        id="email"
        name="email"
        autoComplete="email"
        className="field"
      />
      <p className="field-label">Redes Sociales</p>
      <TextField
        variant="outlined"
        margin="normal"
        required
        id="email"
        name="email"
        autoComplete="email"
        className="field"
      />
      <ControlPointIcon />
    </div>
  );
};
